class Assets {
    constructor() {
        this.assets = new Map();
        this.assets.set('tower', new Image());
        this.assets.get('tower').src = 'data:image/png;base64,';
        this.assets.set('rocket', new Image());
        this.assets.get('rocket').src = 'data:image/png;base64,'
        this.assets.set('explosion_small', new Image());
        this.assets.get('explosion_small').src = 'data:image/png;base64,';
        this.assets.set('explosion_big', new Image());
        this.assets.get('explosion_big').src = 'data:image/png;base64,';
        this.assets.set('grass_tile', new Image());
        this.assets.get('grass_tile').src = 'data:image/png;base64,';
        this.assets.set('dirt_tile', new Image());
        this.assets.get('dirt_tile').src = 'data:image/png;base64,';
        this.assets.set('airplane', new Image());
        this.assets.get('airplane').src = 'data:image/png;base64,';
    }

    getAsset(name) {
        return this.assets.get(name);
    }
}

const assets = new Assets();
export default assets;
